from fontTools.ttLib import TTFont
import base64
"""
1、网站只有一套字体可以人工构建字体映射
2、往往一个网站有有多套字体，并且字形对象也不相等，此时只能通过机器学习或者文字识别API
3、'\uea1a' 是16进制的unicode码，通过"%x" % ord(char)来显示
"""

# 4、获取字形的名字
font = TTFont('../9fc50aa7.woff')
code_list = font.getGlyphOrder()[2:]

for code in code_list:
    # 5、字形对象
    font['glyf'][code]



